import '../styles/Home.css';
import React from 'react';
//import pic from './public/img/nuwc.jpg'

function Home() {
  return (
    <div className='header' style={{ backgroundImage:`url(${process.env.PUBLIC_URL+'/nuwc.jpg'})` , 
    backgroundRepeat: 'no-repeat', width: '250px'}}>
        <p><strong>Welcome to NavTask!</strong></p>
        
    </div>
  );
}

export default Home;
